               <div class="w-[71.3689567430026vw] md:w-[30vw] lg:w-[29vw] mt-[12vw] md:mt-[9.965625vw] lg:mt-[9.53125vw] h-fit">
                  <p class="text-[4.07124681933842vw] md:text-[2.08333333333333vw] lg:text-[1.5625vw] leading-[4.83460559796438vw] md:leading-[2.47395833333333vw] lg:leading-[1.953125vw] font-quicksand font-normal text-[#291810]">“Kleintjes hebben grote magie in zich” en dat is precies waarom ik doe wat ik doe. <br><br>Ik ben Francesca, moeder van een puberzoon, en al mijn leven wonende in De Ronde Venen. Mijn roots liggen echter verder weg, in het kleurrijke Zuid-Afrika en het zonnige Italië, dankzij mijn ouders. Die mix van warmte, nuchterheid en een vleugje Italiaanse flair neem ik mee in alles wat ik doe.</p>
                  <p class="text-[4.07124681933842vw] md:text-[2.08333333333333vw] lg:text-[1.5625vw] leading-[4.83460559796438vw] md:leading-[2.47395833333333vw] lg:leading-[1.953125vw] font-quicksand font-normal text-[#291810] block md:hidden lg:block"><br>Na 13 mooie jaren in de kinderopvang, en vooral bij de allerkleinste, ontdekte ik de kracht van babymassage. Dat inspireerde me om verder te gaan en Docent babymassage te worden. En zo ontstond Kleinding, een naam die voor mij een diepere betekenis heeft: het was mijn bijnaam van mijn Oupa, die mij altijd “kleinding” noemde.<br><br>In diezelfde arme, persoonlijke sfeer kijk ik ernaar uit om samen met jou een mooie start te maken met jouw kleintje!</p>
                  <div class="block md:hidden lg:block">
                     <a href="#" class="button mt-[6.87022900763359vw] md:mt-[3.77604166666667vw] lg:mt-[2.65625vw]">Contact</a>
                  </div>
               </div>
            </div>
            <div class="ml-[10.1781170483461vw] md:ml-[7.55208333333333vw] lg:ml-[7.265625vw] w-[69.3841145833333vw] hidden md:block lg:hidden relative z-[6]">
               <p class="text-[4.07124681933842vw] md:text-[2.08333333333333vw] lg:text-[1.5625vw] leading-[4.83460559796438vw] md:leading-[2.47395833333333vw] lg:leading-[1.953125vw] font-quicksand font-normal text-[#291810]"><br>Na 13 mooie jaren in de kinderopvang, en vooral bij de allerkleinste, ontdekte ik de kracht van babymassage. Dat inspireerde me om verder te gaan en Docent babymassage te worden. En zo ontstond Kleinding, een naam die voor mij een diepere betekenis heeft: het was mijn bijnaam van mijn Oupa, die mij altijd “kleinding” noemde.<br><br>In diezelfde arme, persoonlijke sfeer kijk ik ernaar uit om samen met jou een mooie start te maken met jouw kleintje!</p>
