                        <ul>
                           <li>Voor “vriendjes & vriendinnetjes” of  “twins” cursus;</li>
                           <li>Voor baby’s van 6 weken tot +/- 9 maanden oud;</li>
                           <li>Duo les (2x; één ouder/verzorger + één baby);</li>
                           <li>3 lesblokken van 1 à 1,5uur;</li>
                           <li>Massage bij jullie thuis;</li>
                           <li>Ik doe de technieken voor op de demo baby en jij op je eigen kleintje;</li>
                           <li>Incl. massageolie & reader;</li>
                           <li>Er kan een babythema besproken worden bijvoorbeeld: huilen, darmkrampjes o.i.d. mits vooraf aangegeven;</li>
                           <li>Optioneel afsluiting cursus met Tummy Tub (meerprijs: €5,- per kindje).</li>
                        </ul>
